import React from "react";
const Form = () => {
  return (
    <React.Fragment>
      <label>ID:</label>
      <input type="number"></input>
      <label>Product:</label>
      <input type="text"></input>
      <label>Price:</label>
      <input type="number"></input>
    </React.Fragment>
  );
};
export default Form;
